contract GKenERC20 is  ERC20, Pausable, Ownable {
    using SafeMath for uint256;

    uint256 public sellFeeRate = 5; // 5% fee
    uint256 public buyFeeRate = 3; // 3% fee

    event FeesChanged(
        uint256 sellFeeRate,
        uint256 buyFeeRate
    );

    constructor(string memory name, string memory symbol) ERC20(name, symbol) {
         
    }
    
    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }

    
    function setTransferFeeRate(uint256 sellFee, uint256 buyFee ) external onlyOwner {
        sellFeeRate = sellFee;
        buyFeeRate = buyFee;
        emit FeesChanged(sellFee, buyFee);
    }

